    "\n",
    "# Fitness Tracker App Data Analytics Case Study\n",
    "## Ask Phase\n",
    "\n",
    "---\n",
    "\n",
    "#### Business Task\n",
    "The business task is to analyze trends in smart device usage using Fitbit data and provide actionable insights to enhance Bellabeat's product offerings and marketing strategy. These insights aim to drive customer engagement and position Bellabeat as a leader in the global smart wellness device market. \n",
    "\n",
    "## Prepare Phase\n",
    "\n",
    "---\n",
    "\n",
    "#### Dataset source\n",
    "The dataset is obtained from kaggle. Click [here](https://www.kaggle.com/datasets/arashnic/fitbit) to access to the data. Datasets are reliable and publicly available, collected using Fitbit devices. They are structured in a wide format and allow exploration of relationships between step, calorie burned and sleep duration.\n",
    "\n",
    "#### Dataset name\n",
    "- dailyActivity_merged.csv- contain activity entries from 12 April 2016 to 12 May 2016 along with steps count and calorie burned on that day by each user.\n",
    "- sleepDay_merged.csv - contain total minutes slept each day by each user.\n",
    "\n",
    "## Process Phase\n",
    "\n",
    "---\n",
    "\n",
    "#### Loading and Inspecting Data\n",
    "Before cleaning the data, load the datasets and inspect their structure to understand their contents and formats."
